import { ICharacter } from "../../interfaces/ICharacter";
import { ISearchResultsProps } from "../../interfaces/ISearchResultsProps";

const SearchResults = ({
  characters,
  status,
  queryError,
  onDelete,
  onSelect,
}: ISearchResultsProps) => {
  return (
    <div className="results">
      {status !== "ERROR"
        ? characters.map((c: ICharacter) => (
            <div className="results-item" key={parseInt(c.id, 10)}>
              <button
                className="results-item__btn"
                data-id={c.id}
                onClick={onDelete}
              >
                X
              </button>
              <img
                className="results-item__image"
                data-id={c.id}
                src={c.image}
                alt={c.name}
                onClick={onSelect}
              />
            </div>
          ))
        : queryError}
    </div>
  );
};

export default SearchResults;
